import './App.css';

function App() {
  return (
    <div className="container-fluid  mt-5">
      <div className='card'>
        <div className='card-header'>
          <div>Username</div>
          <div><input className='form-control'></input></div>
          <div className='mt-3'>
            <div>Password</div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
